import React from 'react';
import './App.css';
import DownloadCSV from './DownloadCSV';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My App</h1>
        <DownloadCSV />
      </header>
    </div>
  );
}

export default App;
